export const setTheme = theme => ({
  type: "SET_THEME",
  theme
});


export const Themes = {
  DARK_THEME: "DARK_THEME",
  LIGHT_THEME: "LIGHT_THEME",
  GREEN_THEME: "GREEN_THEME"
};

export const increment = () => ({
    type: "INCREMENT"
})
